import React from 'react'
import './article.css'
import Kursus02 from './../Billeder/Kursus01png'

const Article = () => {
  return (
    <div className='b__blog-container_article'>
      <div className='b__blog-container_article-image'>
        <img src={Kursus02} alt="Kursus" />

      </div>

    </div>
  )
}

export default Article
